import { useQuery } from "react-query";
import axios from "axios";

const fetchStudents = () => {
  return axios.get("http://localhost:4000/students");
};

const useStudentsData = (onSuccess, onError) => {
  return useQuery("students", fetchStudents, {
    onSuccess,
    onError,
  });
};
